import React, { useState } from 'react';
import Web3 from 'web3';
import './App.css';

const TokenBalance = () => {
  const [chain, setChain] = useState('Mantle');
  const [address, setAddress] = useState('');
  const [balance, setBalance] = useState('');
  const [percentchange, setPercentchange] = useState('');
  const [change, setChange] = useState('change');

  const chains = {
    'choose one of the following': 'mantle',
    mantle: 'mantle',
    linea: 'linea',
  };

  const fetchBalance = async () => {
    try {
      if (typeof window.ethereum !== 'undefined') {
        const web3 = new Web3(chains[chain]);

        await window.ethereum.enable();
        const accounts = await web3.eth.getAccounts();
        const currentAccount = accounts[0];

        if (!currentAccount) {
          alert('Please connect your Ethereum wallet.');
          return;
        }

        const currentBalance = await web3.eth.getBalance(address);
        setBalance(web3.utils.fromWei(currentBalance, 'ether'));
      } else {
        alert('Please install MetaMask or use a web3-enabled browser.');
      }
    } catch (error) {
      alert(`Error: ${error.message}`);
    }
  };

  const fetchBalance2 = () => {
    let headers = new Headers();
    headers.set('Authorization', 'Bearer cqt_rQY3kTGRY7pwfPRvVQ7XgwKrYpQg');
    let token = '0xDCBc586cAb42a1D193CaCD165a81E5fbd9B428d7';
    let token_address = token.toLowerCase();

    fetch(`https://api.covalenthq.com/v1/${chain}-mainnet/address/${address}/portfolio_v2/?`, {
      method: 'GET',
      headers: headers,
    })
      .then((resp) => resp.json())
      .then((data) => {
        console.log(data);
        const changeinprice =
          data.data.items[0].holdings[0].close.quote - data.data.items[0].holdings[1].close.quote;

        const percentinc_or_dec =
          ((data.data.items[0].holdings[0].close.quote - data.data.items[0].holdings[1].close.quote) /
            data.data.items[0].holdings[1].close.quote) *
          100;

        console.log(percentinc_or_dec);

        if (percentinc_or_dec > 0) {
          setPercentchange(percentinc_or_dec);
          if (percentinc_or_dec >= 10) {
            alert(`Alert: The percentage change is ${percentinc_or_dec.toFixed(2)}%, exceeding 10%.`);
          }
          setChange('increament');
        } else if (percentinc_or_dec < 0) {
          percentinc_or_dec = percentinc_or_dec * -1;
          setPercentchange(percentinc_or_dec);
          if (percentinc_or_dec >= 10) {
            alert(`Alert: The percentage change is ${percentinc_or_dec.toFixed(2)}%, exceeding 10%.`);
          }
          setChange('decreament');
        } else {
          alert('No change in price');
        }
      });
  };

  return (
    <div className='background'>
      <div className='container'>
        <div className='header'>
          <img className='avatar' src="/Users/anshu/Desktop/project_flintlab/src/flintmoney_logo.jpeg" alt="Avatar" />
          <h1 className='heading'>Token Balance Checker</h1>
        </div>
        <div className='form-group'>
          <label className='label'>Chain:</label>
          <select className='select' value={chain} onChange={(e) => setChain(e.target.value) }>
            {Object.keys(chains).map((chainName) => (
              <option key={chainName} value={chainName}>
                {chains[chainName]}
              </option>
            ))}
          </select>
        </div>
        <div className='form-group'>
          <label className='label'>Address:</label>
          <input className='input' type="text" value={address} onChange={(e) => setAddress(e.target.value)} />
        </div>
        <button className='button' onClick={fetchBalance}>
          Fetch Balance
        </button>
        <p className='result'>Native Token Balance: {balance}</p>
        <button className='button' onClick={fetchBalance2}>
          Fetch Balance 2
        </button>
        <p className={`result percent-change ${change}`}>Percent Change in last 24 hours: {percentchange}%</p>
      </div>
    </div>
  );
};

export default TokenBalance;
